<body>
    <div class="timer--container">
        <div class="show-love-block">
            <p id="show-love-timer"></p>
            <p id="show-love-title">Days</p>
        </div>

	<script>
        function daysBetween(timestamp) {
            const oneDayMs = 1000 * 60 * 60 * 24;
            const today = new Date().setHours(0, 0, 0, 0);
            const otherDate = new Date(timestamp).setHours(0, 0, 0, 0);
            const diffMs = today - otherDate;
            return Math.floor(diffMs / oneDayMs);
        }
		function showLoveTimer() {
            var itm = {};
            // 计算end日期，距离当天相差的天数
            itm.days = daysBetween(1680888051000);
            console.log(itm.days)
            // 还可以结算相差的星期数
            console.log(itm.days);
            document.getElementById("show-love-timer").innerHTML = itm.days;
		}
        showLoveTimer();
	</script>
